import Layout from '../src/components/Layout';
import { Cookies } from 'react-cookie';

//components

const cookies = new Cookies();

const dashboard = () => {
    return (
        <Layout>
            <div className='main'>
                <div className='cabecera'>
                    <div className='logo'>
                        <img src='https://coreui.io/react/demo/static/media/logo.406a451a.svg'></img>
                        <button>
                            <i class="fa fa-bars menu"></i>
                        </button>
                    </div>
                    <div className='opciones'>text-align: center;</div>
                </div>
                <div>Body</div>
            </div>
            <style global jsx>{`
                html,
                body,
                body > div:first-child,
                div#__next,
                div#__next > div,
                div#__next > div > div {
                    height: 100%;
                }

                *{
                    box-sizing: border-box;
                }

                .main{
                    width: 100%;
                    height: 100%;
                    background: linear-gradient(180deg, #C2C0C0, white);
                }

                .cabecera{
                    width: 100%;
                    height: 5%;
                    display: flex;
                    flex-direction: row;
                    justify-content: center;
                    align-items: center;
                }     


                .cabecera .logo{
                    width: 10%;
                    text-align: center;
                    display: flex;
                    background: white;
                    border: 3px solid;
                    text-align: right;

                }

                .cabecera .logo img{
                    width: 50%;
                    margin-right: 10px;
                }

                .cabecera .logo button{    
                    width: 20%;
                    font-size: 20px;
                    color: gray;
                }

                .cabecera .opciones{
                    width: 90%;  
                }
            `}</style>
        </Layout>
    );
}

export default dashboard;
